import{_ as o,o as a,c as r,z as e,a as t}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 64.2-457 Bona fide purchaser of real estate without notice of devise protected; later will.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/64.2-457.md","filePath":"vacode/64.2-457.md"}'),i={name:"vacode/64.2-457.md"},s=e("h1",{id:"§-64-2-457-bona-fide-purchaser-of-real-estate-without-notice-of-devise-protected-later-will",tabindex:"-1"},[t("§ 64.2-457 Bona fide purchaser of real estate without notice of devise protected; later will. "),e("a",{class:"header-anchor",href:"#§-64-2-457-bona-fide-purchaser-of-real-estate-without-notice-of-devise-protected-later-will","aria-label":'Permalink to "§ 64.2-457 Bona fide purchaser of real estate without notice of devise protected; later will."'},"​")],-1),l=e("p",null,"The title of a bona fide purchaser without notice from the devisee, or from the personal representative with power to sell, encumber, lease, or exchange, under the will of a person who has died heretofore, or may die hereafter, having title to any real estate of inheritance in the Commonwealth, shall not be affected by any other devise of such real estate made by the testator in another will, unless within one year after the testator's death such other will or, if such other will has been probated outside of the Commonwealth, an authenticated copy thereof and the certificate of probate shall be filed for probate before the court or clerk having jurisdiction for that purpose and shall afterwards be admitted to probate and recorded in the proper court or clerk's office as a will of real estate.",-1),n=e("p",null,[t("Code 1950, § 64-92; 1968, c. 656, § 64.1-96; 2012, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0614",target:"_blank",rel:"noreferrer"},"614"),t(".")],-1),c=[s,l,n];function h(d,f,p,u,w,_){return a(),r("div",null,c)}const v=o(i,[["render",h]]);export{b as __pageData,v as default};
